INSERT INTO `noticeContet` VALUES ('514c7989a1aa41be939ddfaa555df2ac', '我校与柳州日报社签订战略合作框架协议', '2019-01-02 18:33:00', '<p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/0/0C/5F/2968EB81B308616921BC5692C59_9EE5530C_22CC1.jpg\"></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><span><b>签约仪式会场</b></span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/A/93/51/5A27D008777774E4A7E1DAC5A4A_0C1F398A_20A9E.jpg\"></p><p style=\"text-align: center;\"><span><b>签订协议</b></span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/7/80/FE/AFCF9B6342E083635D2AA2E7696_FAD90B52_23903.jpg\"></p><p style=\"text-align: center;\"><span><b>参观学校规划沙盘</b></span></p><p style=\"text-align: center;\"><span><b><br></b></span></p><p>&nbsp; &nbsp; &nbsp; &nbsp;4月25日上午，我校与柳州日报社在行政办公楼5—1会议室举行战略合作框架协议签约仪式。柳州日报社总编辑、党委副书记吴怀辉，党委委员、副总编辑李广西等一行5人，我校党委副书记、纪委书记张正义，党政办、宣传部、学工部（处）、校团委和大学生全媒体中心负责人参加签约仪式。签约仪式由校党委常委、宣传部部长蔡亮主持。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;张正义首先代表学校党委和行政对柳州日报社领导的到来表示热烈欢迎。他指出，今年1月25日中共中央政治局在人民日报社举行第十二次集体学习时，习近平总书记关于全媒体时代和媒体融合发展的重要讲话精神，为我校与柳州日报社建立“媒体+高校”战略合作关系提供了根本遵循。双方建立战略合作关系，是学校进一步深化“校市相融、校企合作”办学特色，落实“学习先进，实干兴特色”“开放合作，改革促发展”两大发展战略的实际行动。我校将借助柳州日报社在人才、资源和技术方面的优势，在融媒体建设、业务培训、舆情导控等方面开展交流与合作，以开创学校宣传思想文化工作新局面。同时，我校将充分发挥有关学科专业和人才资源的优势，为柳州日报社推动媒体融合发展、构建全媒体传播格局提供支持。希望双方以此次签约为契机，不断加深合作的广度和深度，实现双嬴，更好地服务地方经济社会发展。</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 吴怀辉介绍了柳州日报社全媒体矩阵建设情况。他表示，柳州日报社将充分发挥“报、网、端、微、屏”的矩阵优势，助力学校提升宣传工作的传播力、思想工作的引领力和文化工作的影响力，同时希望学校利用学科专业和人才优势，为柳州日报社的发展提供相应支持，双方强强联合、互利共赢，共同推动“媒体+高校”战略合作不断取得实质性进展。</p><p>&nbsp; &nbsp; &nbsp; &nbsp; 张正义、吴怀辉代表双方签订了《广西科技大学 柳州日报社战略合作框架协议》。根据协议内容，柳州日报社将利用全媒体矩阵和舆情导控方面的优势，在宣传领域为学校提供全面的支持。我校将为柳州日报社传统媒体转型、新媒体矩阵拓展等工作提供相关支持。</p><p class=\"vsbcontent_end\">双方还就建立“媒体+高校”合作新模式相关具体问题，进行了深入的交流探讨。签约仪式前，吴怀辉一行在张正义的陪同下参观了学校规划沙盘。</p>');
INSERT INTO `noticeContet` VALUES ('540a255ace324f78ab0dd234f6cce070', '学校召开社会科学界联合会第一届委员会第二次全体会议', '2019-01-15 15:38:11', '<p style=\"text-align: center; \">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"http://www.gxust.edu.cn/__local/3/B6/76/FF1F600BA54A800C957AC830899_C4EAE807_22209.jpg\"></p><p>&nbsp; &nbsp; &nbsp; 5月7日上午，广西科技大学社会科学界联合会（简称“学校社科联”）第一届委员会第二次全体会议在东环校区行政办公楼5—1会议室召开。学校社科联第一届委员会全体委员参加会议。会议由校党委副书记、纪委书记、学校社科联主席张正义主持。</p><p>&nbsp; &nbsp; &nbsp; 会议经过表决，首先增补和调整了学校社科联第一届委员会委员及领导机构成员。校党委常委、宣传部部长、学校社科联<a></a>副主席蔡亮受学校社科联第一届委员会委托作2018年工作总结，简要回顾了学校社科联过去一年取得的主要成绩、存在的主要问题及今后的努力方向。会议审议通过了《广西科技大学社会科学界联合会2019年工作要点》和《广西科技大学社会科学界联合会第一届委员会第二次全体会议决议》。</p><p class=\"vsbcontent_end\">&nbsp; &nbsp; &nbsp; 张正义作总结讲话，对学校社科联今后的工作提出四点意见。一要坚持不忘初心、牢记使命，用马克思主义指导哲学社会科学。他要求，学校广大哲学社会科学工作者，要坚信马克思主义的科学性，把一切从实际出发、实事求是的原则落实到哲学社会科学各学科领域的研究中，引导广大师生树牢“四个意识”，坚定“四个自信”，坚决做到“两个维护”，在思想上政治上行动上同以习近平同志为核心的党中央保持高度一致。二要坚持围绕中心、服务发展大局，助力学校建设国内先进有特色高水平应用型大学。他强调，学校哲学社会科学事业发展，要主动聚焦广大师生建设国内先进有特色高水平应用型大学的具体实践，研究解决事关改革发展全局的重大问题，要切实增强做好社科联工作的责任感和使命感，围绕中心服务大局，以更高的站位、更远的眼光、更大的胆识和力度解放思想、创新思维方式，谋划和推动社科联各项工作不断取得新进展。三要坚持解放思想、守正创新，推动学校哲学社会科学事业繁荣发展。他指出，社科联工作的关键在“联”，要坚持解放思想、实事求是、与时俱进，不断扩大“联”的范围，健全“联”的机制，优化“联”的环境，创新“联”的方式，打造“联”的平台，拓宽“联”的渠道，提高“联”的实效。四要坚持为师生服务、躬身实践，做好团结联系广大哲学社会科学工作者的桥梁纽带。他希望，学校社科联要不断增强政治性、先进性、群众性，要加大对各会员单位和社科类群众团体的政治指导、业务指导和管理服务，组织开展好哲学社会科学研究，大力弘扬优良学风，营造风清气正的学术生态，把广大哲学社会科学工作者的积极性引导好、主动性保护好、创造性发挥好，努力打造哲学社会科学工作者的“温馨之家”。</p>');
INSERT INTO `noticeContet` VALUES ('fb69bbeeb9e046258b9a391df0c03704', '我校举行大学生全媒体中心成立大会', '2019-01-02 17:44:58', '<p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/5/C9/58/D60F23E70EF3820F7850E66735E_85C5591C_241AF.jpg\"></p><p style=\"text-align: center;\"><span><b>成立大会现场</b></span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/1/D8/45/50B431496EB31ACF34F7D24B564_E155C292_431C5.jpg\"></p><p style=\"text-align: center;\"><span><b>为大学生全媒体中心首批指导教师颁发聘书</b></span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/E/79/00/A52D1EA961101F15FC1F140FAD6_98A831B8_401DD.jpg\"></p><p style=\"text-align: center;\"><span>为大学生全媒体中心揭牌</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp;4月20日上午，广西科技大学大学生全媒体中心（以下简称“中心”）成立大会在东环校区行政办公楼多功能报告厅举行。校党委副书记、纪委书记张正义，党委宣传部、党委学生工作部（学生工作处）、校团委领导及相关人员，校学生会、研究生会、社团联合会、青年志愿者总会、大学生科创中心和各二级学院学生会干部代表，中心全体人员共计200多人参加会议。大会由党委宣传部副部长宋海霞主持。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;校党委常委、宣传部部长蔡亮首先介绍了中心的有关情况，着重介绍了中心成立的必要性、管理机制、运行机制、工作职责和成立后开展的主要工作。他指出，中心的成立，是适应当前媒体融合、一体发展，应对全媒体时代新形势新任务新要求的一项重要举措，翻开了学校传统媒体和新媒体融合发展新的一页，对克服学校传统媒体与新媒体单打独斗、力量分散的局面，加强和改进学校宣传思想文化工作，强化舆论引导和舆情管控，进一步巩固和壮大社会主义主流意识形态，增强引领力、凝聚力和向心力，具有重要的里程碑意义。</p><p>&nbsp; &nbsp; &nbsp; 中心主任、校学生会副主席、经济与管理学院王艮南同学在发言中表示，中心的成立使广大热爱新闻事业的在校生拥有了更丰富的资源、更广阔的平台施展才华，使命光荣，责任重大。她号召中心全体成员在学校党委的正确领导和党委宣传部的带领下，团结一心，砥砺奋进，攻坚克难，不辱使命，努力开创中心各项工作新局面，助力学校宣传思想文化工作迈上新台阶。</p><p>与会领导为大学生全媒体中心首批指导教师颁发了聘书。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;张正义代表学校党委和行政，对中心的成立表示热烈祝贺。他指出，中心的成立既是为了响应习近平总书记在全国宣传思想工作会议上“建设具有强大凝聚力和引领力的社会主义意识形态，是全党特别是宣传思想战线必须担负起的一个战略任务”重要讲话精神的实际行动，同时也是落实今年1月25日中共中央政治局在人民日报社就全媒体时代和媒体融合发展举行第十二次集体学习时，习近平总书记提出“加快推动媒体融合发展、构建全媒体传播格局”的具体举措。他结合大学生全媒体中心的工作定位，对中心和全体成员提出了四点要求：一是要推动媒体融合，形成强大宣传合力；二是守牢宣传阵地，确保意识形态安全；三是讲好科大故事，共塑发展新形象；四是服务青年成长，增强服务能力本领。他勉励同学们认真对照习近平总书记“政治过硬、本领高强、求实创新、能打胜仗”的工作标准，严格按照中心的工作定位，在学习中长知识、在实践中强本领，用双脚丈量校园，用镜头记录生活，用笔墨抒写时代，为建设国内先进有特色高水平应用型大学作出积极贡献。</p><p><span>&nbsp; &nbsp; &nbsp; &nbsp;在热烈的掌声中，张正义、蔡亮为大学生全媒体中心揭牌。</span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/1/7C/19/4D99EF3494209A5428F684AAF94_2FDE32F3_41201.jpg\"></p><p style=\"text-align: center;\"><span><b>培训会现场</b></span></p><p style=\"text-align: center;\"><img src=\"http://www.gxust.edu.cn/__local/8/3D/2F/5361C1D5F43B4AEB1E04C30FDEF_5B8ADC3E_40FE0.jpg\"></p><p style=\"text-align: center;\"><span><b>学生踊跃提问交流</b></span></p><p style=\"text-align: center;\"><span style=\"text-align: start;\">&nbsp; &nbsp; &nbsp; &nbsp;成立大会后，柳州日报社助理首席记者、新华社签约摄影师、原广西工学院学生记者团团长黎寒池，受邀为大学生全媒体中心全体成员作了题为《全媒体时代如何用影像讲好故事》的培训。他讲述了自己从文字记者到摄影记者再到全媒体记者转型的过程，分析了基于全民摄影环境下摄影师的机遇与转型，融媒体</span></p><p style=\"text-align: center;\"><span style=\"text-align: start;\">境下如何用影像讲好故事，并通过大量实例阐述了用影像讲好故事要有信心、耐心和进取心。培训结束后，黎寒池还与在场的同学们进行了现场交流。&nbsp;</span></p>');
